import 'date-fns';
import React, { useEffect } from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import Container from '@material-ui/core/Container';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import DateFnsUtils from '@date-io/date-fns';
import moment from 'moment';
import { Btn_evaluar } from './funciones';
import {
    MuiPickersUtilsProvider,
    KeyboardDatePicker,
} from '@material-ui/pickers';
import { useStyles } from './styles';
import { EXISTNCIA_ACTA } from '../servicios/api';
import {FechaDate} from './dates'




const Entregas = () => {

    const classes = useStyles();
    const fecha_Defaul = moment(new Date()).format('YYYY-MM-DD, h:mm:ss a');
    const [entrega1, setEntrega1] = React.useState(fecha_Defaul);
    const [entrega2, setEntrega2] = React.useState(fecha_Defaul);
    const [entrega3, setEntrega3] = React.useState(fecha_Defaul);
    const [entregaFinal, setFinal] = React.useState(fecha_Defaul);
    const [status, setStatus] = React.useState(false);


    useEffect(() => {
        function statusDate() {
            if (EXISTNCIA_ACTA) {
                setStatus(true)
            }
        }

        statusDate()
    }, [])



    return (
        <div>
            <h3 style={{ textAlign: 'center' }}>CALENDARIO DE ENTREGA DE CALIFICACIONES</h3>
            <div className={classes.root}>
                <React.Fragment>
                    <CssBaseline />
                    <Container >
                        <Grid container spacing={5}>
                            <Grid item xs={12} sm={4} >
                                <Paper className={classes.paper} elevation={0}>
                                <FechaDate entrega ={entrega1}  status={status} onGuardar={date => setEntrega1(date)} />
                                   {/* <MuiPickersUtilsProvider utils={DateFnsUtils} >
                                        <Grid container justify="space-around">
                                            <KeyboardDatePicker
                                                disabled={status}
                                                margin="normal"
                                                id="date-picker-dialog"
                                                label="Primera entrega"
                                                format="MM/dd/yyyy"
                                                value={entrega1}
                                                onChange={date => setEntrega1(date)}
                                                KeyboardButtonProps={{
                                                    'aria-label': 'change date',
                                                }} />
                                        </Grid>
                                    </MuiPickersUtilsProvider>*/}
                                </Paper>
                            </Grid>
                            <Grid item xs={12} sm={4}>
                                <Paper className={classes.paper} elevation={0}>
                                    <MuiPickersUtilsProvider utils={DateFnsUtils}>
                                        <Grid container justify="space-around">
                                            <KeyboardDatePicker
                                                disabled={status}
                                                margin="normal"
                                                id="date-picker-dialog"
                                                label="Segunda entrega"
                                                format="MM/dd/yyyy"
                                                value={entrega2}
                                                onChange={date => setEntrega2(date)}
                                                KeyboardButtonProps={{
                                                    'aria-label': 'change date',
                                                }} />
                                        </Grid>
                                    </MuiPickersUtilsProvider>
                                </Paper>
                            </Grid>
                            <Grid item xs={12} sm={4}>
                                <Paper className={classes.paper} elevation={0}>
                                    <MuiPickersUtilsProvider utils={DateFnsUtils}>
                                        <Grid container justify="space-around">
                                            <KeyboardDatePicker
                                                disabled={status}
                                                margin="normal"
                                                id="date-picker-dialog"
                                                label="Tercera entrega"
                                                format="MM/dd/yyyy"
                                                value={entrega3}
                                                onChange={date => setEntrega3(date)}
                                                KeyboardButtonProps={{
                                                    'aria-label': 'change date',
                                                }} />
                                        </Grid>
                                    </MuiPickersUtilsProvider>
                                </Paper>
                            </Grid>
                            <Grid item xs={12}>
                                <Paper className={classes.paper}>
                                    <MuiPickersUtilsProvider utils={DateFnsUtils}>
                                        <Grid container justify="space-around">
                                            <KeyboardDatePicker
                                                disabled={status}
                                                margin="normal"
                                                id="date-picker-dialog"
                                                label="Entrega Final"
                                                format="MM/dd/yyyy"
                                                value={entregaFinal}
                                                onChange={date => setFinal(date)}
                                                KeyboardButtonProps={{
                                                    'aria-label': 'change date',
                                                }} />
                                        </Grid>
                                    </MuiPickersUtilsProvider>
                                </Paper>
                            </Grid>
                            <Grid item xs={4}>
                                <Paper className={classes.paper}>
                                    <Btn_evaluar
                                        primera={entrega1}
                                        segunda={entrega2}
                                        tercera={entrega3}
                                        final={entregaFinal} />
                                </Paper>
                            </Grid>
                        </Grid>
                    </Container>
                </React.Fragment>
            </div>
        </div>
    );
}
export default Entregas
